import React from 'react';
import { Navigate, Outlet } from 'react-router-dom';

const PublicRoute = (Element) => {
    var auth = true; 
    if(localStorage.getItem('auth_token')){
        var auth = false; 
    }

    return auth ? <Element /> : <Navigate to="/admin" />
}

export default PublicRoute;
